INSERT INTO `tbl_ques_main` (`id`, `category`, `question`) VALUES
(1, 1, 'Teacher knows his/her lessons.'),
(2, 1, 'Teacher plans class time and assignments that helps student understand the lesson.'),
(3, 1, 'Teacher provides activities that make subject matter meaningful.'),
(4, 1, 'Teacher relates lessons to real life situations. He/she also reviews past lessons.'),
(5, 1, 'Teacher encourages student to participate in class.'),
(6, 1, 'Teacher gives me good feedback on homework and projects so that I can improve.'),
(7, 2, 'Teacher listens and understands students'' feelings; he/she may not agree, but students feel understood.'),
(8, 2, 'Teacher understands the needs of the students.'),
(9, 2, 'Teacher helps me when I ask for help. I trust this teacher.'),
(10, 2, 'Teacher is fair in discipline. '),
(11, 3, 'Enriches discussions with contemporary issues and events, and relates subject matter to other fields of knowledge.'),
(12, 3, 'Integrates subject matter with values.'),
(13, 3, 'Explains concepts, principles and objectives of the day''s lesson. Organizes and presents subject matter clearly and coherently.'),
(14, 4, 'Communicates in English and/or Filipino fluently.'),
(15, 4, 'Stimulates thinking and clarifies lessons through effective questions.'),
(16, 4, 'Uses a variety of techniques, approaches and strategies to make the lesson interesting and meaningful.'),
(17, 4, 'Provides challenging learning tasks, problems and assignments. Motivates the students to continue learning even outside the classroom.'),
(18, 5, 'Returns corrected test papers and other assignments to students within a reasonable period. '),
(19, 5, 'Has a good classroom discipline.'),
(20, 6, 'Always appears presentable and pleasant.');
